import react from "react";
import { useNavigate } from "react-router-dom";


function Home(){
    const navigate = useNavigate();
    const handleclick = () => {
        navigate('/about');
    }
    return(
        <>
        <h1>This is Home</h1>
        <button onclick={handleclick}>Click me</button>
        </>
    );
}
export default Home;
